import React, { Component } from 'react';

class Home extends Component {
  render() {
    return (
      <div className="content hidden-side">
        <nav className="top-content-nav">
          <ul className="top-list">
            <li className="top-list__item"><a className="top-list__link active" href="#">html</a></li>
            <li className="top-list__item"><a className="top-list__link" href="#">js</a></li>
            <li className="top-list__item"><a className="top-list__link" href="#">css</a></li>
            <li className="top-list__item">
              <a href="block:#add-snippet" className="top-list__button">+</a>
            
            </li>
          </ul>
          
        </nav>
      </div>
    );
  }
}

export default Home;
